\viewkind4\uc1\pard\cf1\f0\fs16 It is an insurance policy that combines various personal insurance protections, which can include losses occurring to one's home, its contents, loss of its use (additional living expenses), or loss of other personal possessions of the homeowner, as well as liability insurance for accidents that may happen at the home or at the hands of the homeowner within the policy territory.\par
\par
It is a multiple-line insurance, meaning that it includes both property and liability coverage, with an indivisible premium, meaning that a single premium is paid for all risks.\par
\par
The cost of homeowner's insurance often depends on what it would cost to replace the house and which additional riders-additional items to be insured-are attached to the policy. The insurance policy itself is a lengthy contract, and names what will and what will not be paid in the case of various events. Typically, claims due to floods or war (whose definition typically includes a nuclear explosion from any source), amongst other standard exclusions (like termites), are excluded. Special insurance can be purchased for these possibilities, including flood insurance.\par
\par
A basic policy form that provides coverage on a home against 11 listed perils; contents are generally included in this type of coverage, but must be explicitly enumerated. The perils include fire or lightning, windstorm or hail, vandalism or malicious mischief, theft, damage from vehicles and aircraft, explosion riot or civil commotion, glass breakage, smoke, volcanic eruption, and personal liability. Exceptions include floods, earthquakes.\f1\par
}

